window.bookSummaryJSON = "<p>Evan was just an average guy working as an EMT, but when he puts on an ancient dragon mask, he’s teleported to the magical world of Inati as a powerful black dragon.<br> </p> <p>Now, he’ll have to save a beautiful priestess, rebuild a broken city, and fight a horde of zombie-like monsters led by an ancient demonic evil.<br> </p> <p>If he wins, then the opportunity to build his powers, treasure horde, and empire will await him. If he loses, then his new friends will all suffer fates worse than death.</p>"; 
